promoBanner.bannerStyle:
p{\
    line-height: 1.5;\
  }\
  #a-spot-banner{\
    display: flex;\
  }\
  #a-spot-text-area{\
    flex: 1;\
    padding: 3%;\
  }\
  .a-spot-title{\
    font-size: 16px;\
  }\
  .a-spot-subtitle{\
    margin-bottom: 5%;\
    font-size: 26px;\
  }\
  .a-spot-text{\
    margin-bottom: 5%;\
  }\
  .how-to-customize-btn{\
    font-size: 14px;\
    padding: 0;\
    margin-bottom: 5%;\
  }\
  #a-spot-carousel{\
    flex: 2;\
    width: 100%;\
    height: 413px;\
    overflow: hidden;\
  }\
  #a-spot-carousel img{\
    height: 100%;\
  }\
  #featured-categories{\
    padding: 1% 0 1% 3%;\
  }\
  .featured-categories-title{\
    margin-bottom: 2%;\
  }\
  #pill-btn-container{\
    display: flex;\
    justify-content: flex-start;\
  }\
  .category-pill-btn{\
    border-radius: 50px;\
    padding: 0.5% 1%;\
    margin-right: 1%;\
    font-size: 14px;\
  }\
  .inactive-pill-btn{\
    color: black;\
    background-color: #B2E0E5;\
    border-color: none;\
  }\
  \
  @media (max-width: 767px){\
    #a-spot-banner{\
      flex-flow: column-reverse;\
    }\
    #a-spot-text-area{\
      padding: 0 3%;\
    }\
    #a-spot-carousel{\
      flex: 1;\
    }\
    .featured-categories-title{\
      margin-bottom: 5%;\
    }\
    #pill-btn-container{\
      overflow-x: scroll;\
      margin-right: 5%;\
    }\
    .category-pill-btn{\
      margin-right: 2.5%;\
      font-size: 12px;\
    }\
  }\
  \
  @media (min-width: 768px) and (max-width: 1023px){\
    #a-spot-text-area{\
      padding: 5% 2.5%;\
    }\
    #pill-btn-container{\
      overflow-x: scroll;\
    }\
    .category-pill-btn{\
      font-size: 12px;\
    }\
  }\
  \
  @media (min-width: 1440px) and (max-width: 1649px){\
    #a-spot-text-area{\
      padding: 7% 2.5%;\
    }\
  }\
  \
  @media (max-width: 1439px){\
    #a-spot-carousel{\
     height: auto;\
    }\
  }
